// ==UserScript==
// @name         Dust2 Cloud Radar
// @namespace    http://tampermonkey.net/
// @version      0.1
// @description  kiddyboxer dust2 radar
// @author       t0gepi
// @match        https://kiddyboxer.net/radar/**
// @icon         https://www.google.com/s2/favicons?sz=64&domain=kiddyboxer.net
// @grant        none
// ==/UserScript==

(function() {
    'use strict';
    let b64 = 'data:image/png;base64,';

    const button1 = document.createElement('button');
    const button2 = document.createElement('button');

    button1.innerText = 'Dust2';
    button2.innerText = 'Rotate 90°';

    button1.style.width = '100px';
    button1.style.height = '40px';
    button1.style.marginBottom = '10px';

    button2.style.width = '100px';
    button2.style.height = '40px';

    const buttonContainer = document.createElement('div');

    buttonContainer.style.position = 'fixed';
    buttonContainer.style.top = '10px';
    buttonContainer.style.right = '10px';
    buttonContainer.style.display = 'flex';
    buttonContainer.style.flexDirection = 'column';

    buttonContainer.appendChild(button1);
    buttonContainer.appendChild(button2);

    document.body.appendChild(buttonContainer);

    button1.addEventListener('click', () => {img.src = b64;});

    let rotationAngle = 0;

    button2.addEventListener('click', () => {
        rotationAngle += 90;
        const mapCanvas = document.getElementById('map');
        mapCanvas.style.transform = `rotate(${rotationAngle}deg)`;
    });
})();
